import React, { useContext, useState } from "react";
import { Link } from "react-router-dom";
import { AuthContext } from "../context/authContext";
import Logo from "../img/logo.png";
import Modal from "react-modal";
import Write from "../pages/Write";
import axios from "axios"; // Import Axios

Modal.setAppElement("#root"); // Set the root element for modal accessibility

const Navbar = () => {
  const { currentUser, logout } = useContext(AuthContext);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState("");
  const [searchResults, setSearchResults] = useState([]);

  const openModal = () => {
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };

  const handleSearchChange = async (event) => {
    const query = event.target.value;
    setSearchQuery(query);

    try {
      const response = await axios.get(`/search?query=${query}`); // Use Axios
      setSearchResults(response.data);
    } catch (error) {
      console.error('Error fetching search results:', error);
    }
  };

  return (
    <div className="navbar">
      <div className="container">
        <div className="logo">
          <Link to="/" style={{ cursor: "pointer" }}>
            <img src={Logo} alt="" />
          </Link>
        </div>
        <div className="search-bar">
          <input
            type="text"
            placeholder="Search..."
            value={searchQuery}
            onChange={handleSearchChange}
          />
          <div className="search-results" style={searchResults.length > 0 ? dropdownStyle : null}>
            {searchResults.length > 0 && (
              <ul style={ulStyle}>
                {searchResults.map(result => (
                  <li key={result.id} style={liStyle}>
                    <Link to={`/profile/${result.username}`} style={linkStyle}>
                      {result.username}
                    </Link>
                  </li>
                ))}
              </ul>
            )}
          </div>
        </div>
        <div className="links">
          <Link
            to={`/profile/${currentUser?.username}`}
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <span>{currentUser?.username}</span>
          </Link>
          {currentUser ? (
            <span onClick={logout}>Logout</span>
          ) : (
            <Link className="link" to="/login">
              Login
            </Link>
          )}
          <span className="write">
            <button className="link" onClick={openModal}>
              Write
            </button>
          </span>
        </div>
      </div>
      <Modal
        isOpen={isModalOpen}
        onRequestClose={closeModal}
        contentLabel="Write Modal"
        style={modalStyle}
      >
        <button style={closeButtonStyle} onClick={closeModal}>
          X
        </button>
        <Write closeModal={closeModal} />
      </Modal>
    </div>
  );
};

// Inline styles
const dropdownStyle = {
  position: "absolute",
  top: "100%",
  left: "0",
  zIndex: "999",
  width: "100%",
  backgroundColor: "#fff",
  boxShadow: "0px 2px 4px rgba(0, 0, 0, 0.2)",
  borderRadius: "4px",
  padding: "8px 0",
};

const ulStyle = {
  listStyleType: "none",
  padding: "0",
  margin: "0",
};

const liStyle = {
  padding: "8px 16px",
};

const linkStyle = {
  color: "#333",
  textDecoration: "none",
};

const modalStyle = {
  content: {
    width: "40%",
    height: "40%",
    margin: "auto",
    padding: "20px",
    borderRadius: "8px",
    overflow: "auto",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.2)",
  },
  overlay: {
    backgroundColor: "rgba(0, 0, 0, 0.5)",
  },
};

const closeButtonStyle = {
  position: "absolute",
  top: "10px",
  right: "10px",
  background: "transparent",
  border: "none",
  cursor: "pointer",
  fontSize: "20px",
  color: "#555",
};

export default Navbar;
